          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
          <Link to="/project">Projects</Link>
          </li>
          <li>
          <Link to="/about">About Me</Link>
          </li>
          <li>
          <Link to="/contact">Contact</Link>
          </li>
        </ul>
        <div className='hamburger'>
          {cli}
          <FaTimes size={20} style={{color: "#fff"}}/>
